import React, { useEffect, useState } from "react";
import axios from "axios";

const Test = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    axios
      .get("api/hello")
      .then((response) => {
        console.log(response);
        setData(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  axios.post("api/hello", {
    data: "hello from React",
  }).then;

  return (
    <div>
      <ul>
        {data.map((data) => (
          <li key={data.id}>{data}</li>
        ))}
      </ul>
    </div>
  );
};

export default Test;
